     1#!/usr/bin/env bun
     2/**
     3 * Get Teamwork Tasks CLI
     4 *
     5 * Query tasks from a Teamwork project and prepare them for agent processing.
     6 *
     7 * Usage:
     8 *   bun run src/cli/get-teamwork-tasks.ts <project_id> [status_filter] [limit]
     9 *
    10 * Parameters:
    11 *   - project_id (required): Teamwork project ID to monitor
    12 *   - status_filter (optional): JSON array of status names, default: ["New", "To Do"]
    13 *   - limit (optional): Max tasks to return, default: 10
    14 *
    15 * This tool is designed to be called as a slash command via Claude Code MCP integration.
    16 * It uses Claude to interact with the Teamwork MCP server.
    17 */
    18
    19import { promptClaudeCodeWithRetry, generateShortId } from '@/modules/agent';
    20import type { AgentPromptRequest } from '@/modules/data-models';
    21import { z } from 'zod';
    22import { TeamworkTaskSchema, type TeamworkTask } from '@/modules/data-models';
    23import { join } from 'path';
    24
    25// ============================================================================
    26// Tag Parsing
    27// ============================================================================
    28
    29/**
    30 * Parse inline tags from task description: {{key: value}}
    31 */
    32function parseInlineTags(description: string): Record<string, string> {
    33  const tags: Record<string, string> = {};
    34  const tagPattern = /\{\{(\w+):\s*([^}]+)\}\}/g;
    35  let match: RegExpExecArray | null;
    36
    37  while ((match = tagPattern.exec(description)) !== null) {
    38    const key = match[1]?.trim() || '';
    39    const value = match[2]?.trim() || '';
    40    if (key && value) {
    41      tags[key] = value;
    42    }
    43  }
    44
    45  return tags;
    46}
    47
    48/**
    49 * Convert native Teamwork tags array to key:value dict.
    50 * Tags are in format "key:value" (e.g., "prototype:vite_vue", "model:sonnet")
    51 */
    52function parseNativeTags(nativeTags: string[]): Record<string, string> {
    53  const tags: Record<string, string> = {};
    54
    55  for (const tag of nativeTags) {
    56    const parts = tag.split(':');
    57    if (parts.length === 2) {
    58      const key = parts[0]?.trim() || '';
    59      const value = parts[1]?.trim() || '';
    60      if (key && value) {
    61        tags[key] = value;
    62      }
    63    }
    64  }
    65
    66  return tags;
    67}
    68
    69/**
    70 * Merge native and inline tags (native takes precedence).
    71 */
    72function mergeTags(nativeTags: Record<string, string>, inlineTags: Record<string, string>): Record<string, string> {
    73  return { ...inlineTags, ...nativeTags };
    74}
    75
    76// ============================================================================
    77// Execution Trigger Detection
    78// ============================================================================
    79
    80/**
    81 * Detect execution trigger from task description.
    82 * Returns: { trigger: "execute" | "continue" | null, prompt: string }
    83 */
    84function detectExecutionTrigger(description: string): {
    85  trigger: string | null;
    86  prompt: string;
    87} {
    88  // Check if description ends with "execute"
    89  const executePattern = /execute\s*$/i;
    90  if (executePattern.test(description)) {
    91    // Remove "execute" and inline tags from prompt
    92    let prompt = description.replace(executePattern, '').trim();
    93    prompt = prompt.replace(/\{\{[^}]+\}\}/g, '').trim();
    94    return { trigger: 'execute', prompt };
    95  }
    96
    97  // Check for "continue - <text>"
    98  const continuePattern = /continue\s*-\s*(.+)/i;
    99  const match = description.match(continuePattern);
   100  if (match) {
   101    const prompt = match[1]?.trim() || '';
   102    return { trigger: 'continue', prompt };
   103  }
   104
   105  return { trigger: null, prompt: '' };
   106}
   107
   108// ============================================================================
   109// Task Processing
   110// ============================================================================
   111
   112/**
   113 * Process a raw Teamwork task into structured TeamworkTask format.
   114 */
   115function processTask(rawTask: any): TeamworkTask | null {
   116  try {
   117    const description = rawTask.description || '';
   118    const nativeTags = rawTask.tags || [];
   119
   120    // Parse tags
   121    const parsedNativeTags = parseNativeTags(nativeTags);
   122    const inlineTags = parseInlineTags(description);
   123    const mergedTags = mergeTags(parsedNativeTags, inlineTags);
   124
   125    // Detect execution trigger
   126    const { trigger, prompt } = detectExecutionTrigger(description);
   127
   128    // Skip if no execution trigger found
   129    if (!trigger) {
   130      return null;
   131    }
   132
   133    // Build TeamworkTask object
   134    const task: TeamworkTask = {
   135      task_id: String(rawTask.id || rawTask.task_id),
   136      project_id: String(rawTask.project_id || ''),
   137      title: rawTask.title || rawTask.content || '',
   138      status: rawTask.status || 'New',
   139      description,
   140      tags: mergedTags,
   141      worktree: mergedTags.worktree,
   142      model: mergedTags.model,
   143      workflow_type: mergedTags.workflow,
   144      prototype: mergedTags.prototype,
   145      execution_trigger: trigger,
   146      task_prompt: prompt,
   147      assigned_to: rawTask.assigned_to || null,
   148      created_time: rawTask.created_time || rawTask.created_at || new Date().toISOString(),
   149      due_date: rawTask.due_date || null,
   150    };
   151
   152    // Validate with Zod schema
   153    return TeamworkTaskSchema.parse(task);
   154  } catch (error) {
   155    console.error(`[WARN] Failed to process task: ${error}`);
   156    return null;
   157  }
   158}
   159
   160// ============================================================================
   161// Main CLI
   162// ============================================================================
   163
   164async function main() {
   165  const args = process.argv.slice(2);
   166
   167  if (args.length < 1) {
   168    console.error('Usage: get-teamwork-tasks <project_id> [status_filter] [limit]');
   169    process.exit(1);
   170  }
   171
   172  const projectId = args[0];
   173  const statusFilterJson = args[1] || '["New", "To Do"]';
   174  const limit = args[2] ? parseInt(args[2]) : 10;
   175
   176  // Parse status filter
   177  let statusFilter: string[];
   178  try {
   179    statusFilter = JSON.parse(statusFilterJson);
   180    if (!Array.isArray(statusFilter)) {
   181      throw new Error('Status filter must be a JSON array');
   182    }
   183  } catch (error) {
   184    console.error(`Invalid status_filter JSON: ${error}`);
   185    process.exit(1);
   186  }
   187
   188  console.error(`[INFO] Querying Teamwork project ${projectId}`);
   189  console.error(`[INFO] Status filter: ${statusFilter.join(', ')}`);
   190  console.error(`[INFO] Limit: ${limit}`);
   191
   192  // Use Claude Code agent to query Teamwork MCP
   193  const adwId = generateShortId();
   194
   195  // Build prompt to query Teamwork tasks
   196  const queryPrompt = `Use the Teamwork MCP tools to query tasks from project ${projectId}.
   197
   1981. First, get the available status IDs for this project
   1992. Filter tasks by these status names (case-insensitive): ${statusFilter.join(', ')}
   2003. Return up to ${limit} tasks
   2014. For each task, include: id, project_id, title, status, description, tags (native Teamwork tags), assigned_to, created_at, due_date
   202
   203CRITICAL: Return ONLY a valid JSON array with NO explanations or markdown. Format:
   204[
   205  {
   206    "id": "123",
   207    "project_id": "${projectId}",
   208    "title": "Task title",
   209    "status": "New",
   210    "description": "Full task description...",
   211    "tags": ["tag1:value1", "tag2:value2"],
   212    "assigned_to": "User Name or null",
   213    "created_at": "2025-01-15T10:00:00Z",
   214    "due_date": "2025-01-20T00:00:00Z or null"
   215  }
   216]
   217
   218If no tasks found, return empty array: []`;
   219
   220  // Create output directory
   221  const outputDir = join(process.cwd(), 'agents', adwId, 'get_teamwork_tasks');
   222
   223  const request: AgentPromptRequest = {
   224    prompt: queryPrompt,
   225    adwId: adwId,
   226    agentName: 'get_teamwork_tasks',
   227    model: 'sonnet',
   228    dangerouslySkipPermissions: true,
   229    outputFile: join(outputDir, 'cc_raw_output.jsonl'),
   230    workingDir: process.cwd(),
   231  };
   232
   233  try {
   234    const response = await promptClaudeCodeWithRetry(request);
   235
   236    if (!response.success) {
   237      console.error(`[ERROR] Claude Code execution failed: ${response.output}`);
   238      process.exit(1);
   239    }
   240
   241    // Parse the JSON response from Claude
   242    let rawTasks: any[];
   243    try {
   244      // Try to extract JSON from response (in case there's extra text)
   245      const jsonMatch = response.output.match(/\[[\s\S]*\]/);
   246      if (!jsonMatch) {
   247        throw new Error('No JSON array found in response');
   248      }
   249      rawTasks = JSON.parse(jsonMatch[0]);
   250    } catch (parseError) {
   251      console.error(`[ERROR] Failed to parse Claude response as JSON: ${parseError}`);
   252      console.error(`[ERROR] Raw response: ${response.output}`);
   253      process.exit(1);
   254    }
   255
   256    // Process tasks
   257    const eligibleTasks: TeamworkTask[] = [];
   258    for (const rawTask of rawTasks) {
   259      const task = processTask(rawTask);
   260      if (task) {
   261        eligibleTasks.push(task);
   262      }
   263    }
   264
   265    // Output as JSON (only to stdout, not stderr)
   266    console.log(JSON.stringify(eligibleTasks, null, 2));
   267  } catch (error) {
   268    console.error(`[ERROR] Failed to query Teamwork: ${error}`);
   269    process.exit(1);
   270  }
   271}
   272
   273if (import.meta.main) {
   274  main().catch((error) => {
   275    console.error(`[ERROR] Fatal error: ${error}`);
   276    process.exit(1);
   277  });
   278}
